function yasuo2(ii,text){
    if(ii==1||ii==3){
        text = text.split("\n").join(" ");
        var t = [];
        var inString = false;
        for (var i = 0, len = text.length; i < len; i++) {
            var c = text.charAt(i);
            if (inString && c === inString) {
                // TODO: \\"
                if (text.charAt(i - 1) !== '\\') {
                    inString = false;
                }
            } else if (!inString && (c === '"' || c === "'")) {
                inString = c;
            } else if (!inString && (c === ' ' || c === "\t")) {
                c = '';
            }
            t.push(c);
        }
        text= t.join('');
    }
    if(ii==2||ii==3){
        text = text.replace(/\\/g,"\\\\").replace(/\"/g,"\\\"");
    }
    if(ii==4){
        text = text.replace(/\\\\/g,"\\").replace(/\\\"/g,'\"');
    }
    return text;
}

